      out.write("function handleDropEvent(event, ui) {\r\n");
      out.write("    var weekTemplateId = $(ui.draggable).attr(\"weekTemplateId\");\r\n");
      out.write("    var calendarDayIndex = $(this).attr(\"calendarDayIndex\");\r\n");
      out.write("    var date = calendarDays[calendarDayIndex].date;\r\n");
      out.write("\r\n");
      out.write("    if (date.day() == 0 && date.date() != 1)\r\n");
      out.write("        date = date.subtract(\"days\", 1);\r\n");
      out.write("\r\n");
      out.write("    if (date.day() != 0) {\r\n");
      out.write("        if (date.startOf(\"week\").diff(date.startOf(\"month\"), \"days\") < 0)\r\n");
      out.write("            date = date.startOf(\"month\");\r\n");
      out.write("        else\r\n");
      out.write("            date = date.startOf(\"week\").add(\"days\", 1);\r\n");
